import React from 'react';

const PageLinks = () => {
    const pageNavigationlinks = ['stories', 'features', 'pricing'];

    return (
        <ul className="page__links__container">
            {pageNavigationlinks.map((link, i) => (
                <li className="page__link" key={i}></li>
            ))}
        </ul>
    )
}

export default PageLinks;
